DataSource.RecordSource:
PARAMETERS [Beginning Date] DateTime 1/1/1994, [Ending Date] DateTime 1/1/2001;
         SELECT Employees.Country, Employees.LastName, Employees.FirstName, Orders.ShippedDate, Orders.OrderID, [Order Subtotals].Subtotal AS SaleAmount
         FROM Employees INNER JOIN (Orders INNER JOIN [Order Subtotals] ON Orders.OrderID = [Order Subtotals].OrderID) ON Employees.EmployeeID = Orders.EmployeeID
         WHERE (((Orders.ShippedDate) Between [Beginning Date] And [Ending Date]));

SELECT Categories.*, Products.*
        FROM Categories INNER JOIN Products ON Categories.CategoryID = Products.CategoryID
        ORDER BY Categories.CategoryName, Products.ProductName;

SELECT Orders.ShippedDate, Orders.OrderID, [Order Subtotals].Subtotal, DatePart("q",Orders.ShippedDate) As ShippedQuarter
        FROM Orders INNER JOIN [Order Subtotals] ON Orders.OrderID = [Order Subtotals].OrderID
        WHERE (((Orders.ShippedDate) Is Not Null));
